import React from 'react';
import { Link } from 'react-router-dom';

export default function SecondPage() {
  return (
    <div>
      <h2>Bienvenue sur la deuxième page !</h2>
      <Link to="/">
        <button>Retourner à la page d'accueil</button>
      </Link>
    </div>
  );
}
